import React from 'react';
import './App.css';

export default class App extends React.Component {
  state = {
    person: [{ name: 'John' }, { name: 'Vlo' }],
  };

  render() {
    return (
      <div className='App'>
        <p></p>
      </div>
    );
  }
}
